description:
Mobile Doc Scanner (MDScan) is a new business tool exclusively for your Android device! 
Extremely useful mobile tool gives users the power to transform any file into PDF format and share it right from your device.

With MDScan users are free to scan any type of document, ranging from receipts to text pages and almost everything in between, on the go anywhere and anytime.

A perfect companion for busy users, MDScan allows anyone to transform everything from invoices to whiteboards and classes notes, magazine articles and more into a PDF format in order to easily export them, share  and e-mail it to others, or for any other reason they can come up with.
